INSERT INTO `posts` (`post_id`, `headline`, `post`, `name`, `image`, `post_date`) VALUES
(1, '146 villages have gone under water within a day as the water level of the Padma is currently above the danger level.', '146 villages have gone under water within a day as the water level of the Padma is currently above the danger level. In Manikganj, different places on the banks of the river Jamuna along with croplands have gone under water. \r\n											On a hopeful note, our correspondents report, that the water level of the Teesta and Dharla rivers have gone below the danger level and that the water has started to recede in Thakurgaon, Panchagarh, Nilphamari, Lalmonirhat, Dinajpur and Kurigram except low lying areas. \r\n											â€œI got a quarter kilogram of flattened rice (Chira) as relief in last four daysâ€, alleged Jyoti Bala Roy, 62, of Maljhar village, who took shelter at Maljhar Government Primary School under Biral upazila of Dinajpur on Saturday when her village flooded.\r\n											Like her, many flood affected people of Biral upazila of Dinajpur are still without access to government relief.   \r\n											According to reports from our correspondents in the northern districts, a vast area has been inundated in the region as flood-protection embankments were breached in Saidpur of Nilphamari, Lalmonirhat, Dinajpur, Kurigram, Rajshahi and Badarganj of Rangpur.  \r\n											Around 1,000 educational institutions in Lalmonirhat, Panchagarh, Nilphamari, Kurigram, Gaibandha, Bogra, Jamalpur, Tangail, Sunamganj and Sylhet have been closed as those have been either flooded or flood-hit people have taken shelter there. Bangladesh is no stranger to flood related disasters. Much of the country is built on low-lying and flood-prone areas, making it particularly vulnerable to seasonal monsoon rains. In 2007 more than half of Bangladesh was seriously affected by deadly monsoon flooding, leading to over 1,000 deaths, the majority of them children. For days, the family subsisted on a diet of puffed rice as they could no longer cook. ', 'flood-4.jpg', , '2018-04-11');
INSERT INTO `posts` (`post_id`, `headline`, `post`, `name`, `image`, `post_date`) VALUES
